$(document).ready(function() {
    function e() {
        for (var e = document.querySelector(".cursor"), n = document.querySelectorAll("a"), o = !1, t = 0; t < n.length; t++) {
            var i = n[t];
            i.addEventListener("mouseover", function() {
                e.classList.add("active")
            }),
            i.addEventListener("mouseout", function() {
                e.classList.remove("active")
            })
        }
    }
    function n() {
        $("main.wrapper h1 span.welcome span").hide().each(function(e) {
            $(this).delay(300 * e).fadeIn(500)
        }),
        $("main.wrapper h1 span.first span").hide(),
        setTimeout(function() {
            $("main.wrapper h1 span.first span").each(function(e) {
                $(this).delay(400 * e).fadeIn(550)
            })
        }, 1e3),
        $("main.wrapper h1 span.second span").hide(),
        setTimeout(function() {
            $("main.wrapper h1 span.second span").each(function(e) {
                $(this).delay(400 * e).fadeIn(550)
            })
        }, 4.5e3),
        $("main.wrapper h1 span.about span").hide(),
        setTimeout(function() {
            $("main.wrapper h1 span.about span").each(function(e) {
                $(this).fadeIn(900)
            })
        }, 9e3)
    }

    e(),
    n(),
    setTimeout(function() {
        AOS.init({
            offset: 50,
            easing: "ease-in-sine"
        })
    }, 50),
    o()
});
